/*Table structure for table `buku` */

DROP TABLE IF EXISTS `buku`;

CREATE TABLE `buku` (
  `ID_Buku` char(10) NOT NULL,
  `Judul_Buku` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `Pengarang_Buku` varchar(45) NOT NULL,
  `Tahun_Terbit` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `ID_Kategori` char(10) NOT NULL,
  `ID_Penerbit` char(10) NOT NULL,
  `Gambar` longblob,
  `Stok` int NOT NULL,
  PRIMARY KEY (`ID_Buku`),
  KEY `fk_Buku_Kategori1_idx` (`ID_Kategori`),
  KEY `fk_Buku_Penerbit1_idx` (`ID_Penerbit`),
  CONSTRAINT `fk_Buku_Kategori1` FOREIGN KEY (`ID_Kategori`) REFERENCES `kategori` (`ID_Kategori`),
  CONSTRAINT `fk_Buku_Penerbit1` FOREIGN KEY (`ID_Penerbit`) REFERENCES `penerbit` (`ID_Penerbit`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

