/*Table structure for table `detail_peminjaman` */

DROP TABLE IF EXISTS `detail_peminjaman`;

CREATE TABLE `detail_peminjaman` (
  `ID_Peminjaman` char(10) NOT NULL,
  `ID_Buku` char(10) NOT NULL,
  `Jumlah_Pinjam` int NOT NULL,
  `Status_Peminjaman` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  KEY `fk_Detail_Peminjaman_Buku1_idx` (`ID_Buku`),
  KEY `ID_Peminjaman` (`ID_Peminjaman`),
  CONSTRAINT `detail_peminjaman_ibfk_1` FOREIGN KEY (`ID_Peminjaman`) REFERENCES `peminjaman` (`ID_Peminjaman`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_Detail_Peminjaman_Buku1` FOREIGN KEY (`ID_Buku`) REFERENCES `buku` (`ID_Buku`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

