/*Table structure for table `detail_pengembalian` */

DROP TABLE IF EXISTS `detail_pengembalian`;

CREATE TABLE `detail_pengembalian` (
  `ID_Pengembalian` char(10) NOT NULL,
  `ID_Buku` char(10) NOT NULL,
  `Jumlah_Denda` double NOT NULL,
  KEY `fk_Detail_Pengembalian_Buku1_idx` (`ID_Buku`),
  KEY `ID_Pengembalian` (`ID_Pengembalian`),
  CONSTRAINT `detail_pengembalian_ibfk_1` FOREIGN KEY (`ID_Pengembalian`) REFERENCES `pengembalian` (`ID_Pengembalian`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `detail_pengembalian_ibfk_2` FOREIGN KEY (`ID_Buku`) REFERENCES `buku` (`ID_Buku`) ON DELETE CASCADE ON UPDATE CASCADE
